import { Button } from "bootstrap";
import React from "react";
import Firebase from "../../firebase";
import NavBarPrefix from "../NavBarPrefix";
export default function NavBar() {

  const downloadTxtFile = () => {
    const element = document.createElement("a");
    const file = new Blob(["hello world"], {
      type: "text/plain"
    });
    element.href = URL.createObjectURL(file);
    element.download = "myFile.txt";
    document.body.appendChild(element);
    element.click();





  };
  return (
    <div className="navbar p-3">
      <NavBarPrefix name="IDE" />
      <button onClick={()=>{
        // console.log('hi',Firebase.auth())
        Firebase.auth().signOut()
        .then(function(data) {
          console.log('data',data)
          // Sign-out successful.
        })
        .catch(function(error) {
          console.log('error',error)
          // An error happened
        });
      }} 
      style={{borderRadius:50,backgroundColor:'purple'}} 
       ><text style={{color:'#fff'}}>LOG OUT</text></button>


<button onClick={downloadTxtFile}>Download</button>

    </div>
  );
}
